import Dashboard from '../Dashboard';



//Buildings
import BuildingsList from '../Buildings/BuildingsList';
import AddBuilding from '../Buildings/AddBuilding';
import DeleteBuilding from '../Buildings/DeleteBuilding';
import EditBuilding from '../Buildings/EditBuilding';


let routes = [

  {
    path: "/",
    name: "Splash_screen",
    component: Splash_screen,
    exact: true,
  },
  {
    path: "/dashboard",
    name: "Dashboard",
    component: Dashboard,
    exact: true,
  },
  



  //Buildings
  {
    path: "/locations/buildings/list",
    name: "Buildings",
    component: BuildingsList,
    exact: true,
  },
  {
    path: "/locations/buildings/add",
    name: "Add Building",
    component: AddBuilding,
    exact: true,
  },
  {
    path: "/locations/buildings/delete/:id",
    name: "Delete Building",
    component: DeleteBuilding,
    exact: true,
  },
  {
    path: "/locations/buildings/edit/:id",
    name: "Edit Building",
    component: EditBuilding,
    exact: true,
  },
 
];

export default routes;
